import React from "react";
import { useParams } from "react-router-dom";
import data from "../data/foodData.json";

const DetailPage = () => {
  const { status } = useParams();

  const filteredItems = data.filter(
    (item) => item["Consumption Status"] === status
  );

  return (
    <div style={{ padding: "2rem" }}>
      <h2>üçΩÔ∏è Summary for: {status}</h2>
      <p><strong>Total Items:</strong> {filteredItems.length}</p>

      <table style={{ width: "100%", borderCollapse: "collapse" }}>
        <thead>
          <tr style={{ backgroundColor: "#f2f2f2" }}>
            <th style={{ border: "1px solid #ddd", padding: "8px" }}>Tray ID</th>
            <th style={{ border: "1px solid #ddd", padding: "8px" }}>Food Item</th>
            <th style={{ border: "1px solid #ddd", padding: "8px" }}>Meal Type</th>
            <th style={{ border: "1px solid #ddd", padding: "8px" }}>Flight Route</th>
            <th style={{ border: "1px solid #ddd", padding: "8px" }}>Passenger Age</th>
            <th style={{ border: "1px solid #ddd", padding: "8px" }}>Weight (g)</th>
          </tr>
        </thead>
        <tbody>
          {filteredItems.map((item, index) => (
            <tr key={index}>
              <td style={{ border: "1px solid #ddd", padding: "8px" }}>{item["Tray ID"] || "N/A"}</td>
              <td style={{ border: "1px solid #ddd", padding: "8px" }}>{item["Food Item"]}</td>
              <td style={{ border: "1px solid #ddd", padding: "8px" }}>{item["Meal Type"]}</td>
              <td style={{ border: "1px solid #ddd", padding: "8px" }}>{item["Flight Route"]}</td>
              <td style={{ border: "1px solid #ddd", padding: "8px" }}>{item["Passenger Age"]}</td>
              <td style={{ border: "1px solid #ddd", padding: "8px" }}>{item["Weight (g)"] || "‚Äî"}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DetailPage;
